import React from "react";
import { BarGraph } from "../BarGraph/BarGraph";
import { skills_data } from "../../data";
import "./styles.scss";
export const Skills = () => {
  return (
    <div id="skills">
      <h1 className="heading">Skills</h1>
      <div className="graph-container">
        {skills_data.map((skills) => {
          return (
            <section>
              <p>{skills.name}</p>
              <BarGraph data={skills.data} />
            </section>
          );
        })}
      </div>
    </div>
  );
};
